import './App.css';
import Header from './BTGlasses/Header';
import Tryglasses from './BTGlasses/Tryglasses';

function App() {
  return (
    <div className="App" style={{position: 'relative'}}>

        <img src="./glassesImage/background.jpg"  className='img-fluid' style={{width: '100%'}}/> 
       <div className='layer w-100 h-100' style={{position: 'absolute'}}></div>

     <Header/>
     <Tryglasses/>

    </div>
  );
}

export default App;
